import React from "react";
import Wrapper from "../components/builder/BuilderBody";
import CommonFuntions from "../services/CommonFunctions";
import TemplateSteps from "../components/builder/TemplateSteps";

import Layout from "../components/Layout";
import { hostname } from "os";

const UserProfile = () => {
  const { InitializeUser } = CommonFuntions();
  InitializeUser();
  let array = ["apibox1, apibox2" , "sitebox1"];
  const allocate = (hostName: string) => {
    var new_array = array.filter((item) => item.indexOf(hostName) !== 0);
    var indices: any = new_array.map(function(e:any) { 
      e = parseInt(e.split(hostName)[1]); 
      return e;
    });
    var max = Math.max(indices);
    var new_index = -1;
    for(var i = 1 ;  i < max ; i++){
      if(i !== indices[i]){
        new_index = i ;
      }
    }
    if(new_index === -1){
      var temp_index = max + 1;
      while(new_index === -1){
        if(indices.includes(temp_index)){
          temp_index += 1;
        }
        else{
          new_index = temp_index;
          break;
        }
      }
    }
    array.push(hostName + "" + new_index);
    return hostName + "" + new_index;

  }
  const deallocate = (hostName: string) => {
    var new_array = array.filter((item) => item.indexOf(hostName) !== 0);
    var indices: any = new_array.map(function(e:any) { 
      e.data = parseInt(e.data.split(hostName)[1]); 
      return e;
    });
    var min = Math.max(indices);
    array = array.filter((host:any) => host !== hostName + "" + min);

  }
  allocate("apibox");
  allocate("apibox");
  deallocate("apibox");
  allocate("apibox");
  allocate("sitebox");


  const header= <div className="flex h-full text-2xl items-center text-white">
    <span>User Profile</span>
  </div>

  return <Layout header={header}/>;
};

export default UserProfile;
